import React from 'react';
import { Link } from "react-router-dom";
import { NavLink } from 'react-router-dom';
import styles from './NavBar.module.scss';
import SampleChoiceWrapper from './SampleChoiceWrapper';

const links = [
  { pathname: '/training', text: 'Training', icon: <SampleChoiceWrapper /> },
  { pathname: '/training', text: 'Training1', icon: <SampleChoiceWrapper /> },
];

const Navbar: React.FC = () => {
  return (
    <div className="w-full shadow-inner">
      <div className="flex flex-row">
        <div className="my-auto bg-indigo-500 p-2 shadow-inner pl-4 pr-8 w-1/3">Learning From Human Preferences</div>
        <div className="w-full flex flex-row bg-gradient-to-r from-indigo-500 to-indigo-500/50 py-2">
          {links.map((link) => (
            <NavLink to={link.pathname} className="my-auto p-2 mx-4 rounded-xl flex flex-col hover:bg-cyan-500 shadow-lg shadow-cyan-500/50">{link.text}</NavLink>
          ))}
        </div>
      </div>
    </div>
  );
};

export default Navbar;
